sys_variable_value.value:
(function execute(inputs, outputs) {

var batch = inputs.batch;
var pstate = inputs.pstate;    

var rg = new GlideRecord('x_snc_domain_man_0_domain_indicators');
//rg.addNullQuery('processing_state');
rg.query();
while(rg.next()){
rg.setValue('batch', batch);
rg.setValue('processing_state',pstate);
rg.update();
}



})(inputs, outputs);

